import { BrowserRouter, Routes, Route } from "react-router-dom"
import UserList from "./components/UserList";

function App() {
  return (
    <BrowserRouter className="container">
      <Routes>
        <Route path="/" />
      </Routes>
      <UserList/>
    </BrowserRouter>
  );
}

export default App;
